        #print(torch.norm(poses[:, 3, :] - poses[:, 4, :], dim=1, keepdim=True))
        pose_arrays = (poses - poses[:, 16, :].unsqueeze(1))
        quaternions = compute_quaternions_batch(pose_arrays)
        vec_a = quaternions 
        vec_b = target_poses
        # Quaternion difference defined according to https://stackoverflow.com/questions/22157435/difference-between-the-two-quaternions
        quaternion_diff = vec_a[:, :, 0] * vec_b[:, :, 0] - vec_a[:, :, 1] * -vec_b[:, :, 1] - vec_a[:, :, 2] * -vec_b[:, :, 2] - vec_a[:, :, 3] * -vec_b[:, :, 3]
        #quaternion_diff = torch.clamp(torch.abs(quaternion_diff), -1.0, 1.0)
        quaternion_rot = torch.arccos(torch.abs(quaternion_diff)).nan_to_num(0)
        #print(quaternion_rot)
        #print(pose_arrays)
        pose_rewards =  torch.exp(-0.1 * torch.sum(quaternion_rot ** 2, dim=(1))) # 1 / (1 + torch.sum(torch.sum(pose_diffs ** 2, dim=1), dim=1).nan_to_num(1)).nan_to_num(0) # torch.exp(-0.03 * torch.sum(torch.sum(pose_diffs ** 2, dim=1), dim=1)).nan_to_num(0)
        return pose_rewards


